  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Waccamaw NWR for the next 15 years. This plan
  outlines the Refuge vision and purpose and describes how Waccamaw NWR will contribute
  to the overall mission of the Refuge System. The plan provides an introduction to
  the Refuge, an overview of the CCP process, information about plan development and
  the management direction, and strategies for implementation. Key planning issues
  include: fish and wildlife population management, visitor services, and administration.\",\n\t\"owner_org\":
